import WorkDay from './WorkDay'

 const DiaryList =({workingDiaries,handleDeleteWorkingDay,handleAddWorkingDiary,handleAddWorkingPiece}) => {
        return (
            <div className="row daily-list">
                {workingDiaries.map((workingDiary) => (
                    <WorkDay
                        id = {workingDiary.id}
                        header = {workingDiary.header}
                        date =  {workingDiary.date}
                        handleDeleteWorkingDay = {handleDeleteWorkingDay}  
                        handleAddWorkingDiary = {handleAddWorkingDiary}                   
                    />
                ))}

            </div>
            )

    }

export default DiaryList;
